import { useState } from "react";
import Card from "../Components/card.jsx";
import ExpPage from "../Components/ExpPage.jsx";
import "./styles.css";

const Experiments=()=>{
    const [inOut, setInOut] = useState("");
    var ListOfExperiment = ["VI Characteristics of a Diode","Zener Diode-Voltage Regulator",
    "BJT Common Emitter Characteristics",
    "BJT Common Base Characteristics"];
    return(
        <div>
            <div className="back" onClick={()=>{setInOut(true)}}>{"<"}<b>Back</b></div>
                <div className="expList">
                    <div className="headEx">
                        <h1>Basic Electronics</h1>
                    </div>
                    <Card  data={ListOfExperiment[0]} setInOut={setInOut} />
                    <Card  data={ListOfExperiment[1]} setInOut={setInOut} />
                    <Card  data={ListOfExperiment[2]} setInOut={setInOut} />
                    <Card  data={ListOfExperiment[3]} setInOut={setInOut} />
                    
                </div>
                {(() => {
                    switch (inOut) {
                    case 'start':
                        return <Start handleClick={handleClick} />
                    case 'playing':
                        return <Playing handleClick={handleClick} />
                    case 'won':
                        return <Won handleClick={handleClick} />
                    case 'lost':
                        return <Lost handleClick={handleClick} />
                    default:
                        return null
                    }
                })()}
             
            
        </div>
    );
}

export default Experiments;
